import React, { useState } from "react";

function UserForm() {
  const [signIn, setSignIn] = useState(false);

  return (
    <form>
      <div className="form-group">
        <label for="emailInput">Email:</label>
        <input
          type="email"
          class="form-control"
          placeholder="Please enter your email"
        />
      </div>
    </form>
  );
}

export default UserForm;
